import { initializeApp } from 'firebase/app';
import {
  getAuth,
  signInWithRedirect,
  signInWithPopup,
  GoogleAuthProvider,
} from 'firebase/auth';

const firebaseConfig = {
  apiKey: 'AIzaSyDQfv3CJYjDpQgXtIy-np1UcW__o45oDzc',
  authDomain: 'shopping-92034.firebaseapp.com',
  projectId: 'shopping-92034',
  storageBucket: 'shopping-92034.appspot.com',
  messagingSenderId: '159216649187',
  appId: '1:159216649187:web:aefdc46a124d6fd2e696d6',
};

// Initialize Firebase
const firebaseApp = initializeApp(firebaseConfig);

const provider = new GoogleAuthProvider();
provider.setCustomParameters({
  prompt: 'select_account',
});

export const auth = getAuth();
export const signInWithGooglePopup = () => signInWithPopup(auth, provider);
